@-moz-document domain("163.com") {
#body,#spWrapperHead {
background:none !important;}

#spWrapperHead {
height:150px !important;}

#spWrapperColse,.sp-wrapper-tip {
display:none !Important;}

#js_N_nav {
position:absolute !important;
top:0px;}


#js_N_nav,.ntes-nav-main {
height:30px !important;
line-height:30px !important;}

#js_N_nav > .N-nav-main,
.ntes-nav-main > div,
.ntes-nav-main a {
height:30px !important;}

#js_N_nav > .N-nav-main *{
line-height:30px !important;}


.N-nav-select-list {
margin-top:-25px !important;}


.N-nav-link-bgblack {
height:30px !important;
padding:0px 15px !important;}

.N-nav-select-arr {display:none !Important;}


#js_N_navHighlight,#js_N_logined_warp {
height:30px !important;
background:none !Important;
border:none !Important;
box-shadow:none !important;}

#js_mail_url,.N-nav-select-title {
height:30px !important;}

.N-nav-icons > li {
height:30px !important;}

.N-nav-icons  li em{
margin-top:7px !important;}

#js_N_navWbMsg {
background:none !Important;}

.N-nav-msg-num{
margin-top:1px !important;}


#wrapperbgId,.finance_header {
margin-top:-20px !important;
height:140px !important;}

.area.top-gg-area,.blank20,
.finance_header_gg {
display:none !Important;}


.footerbg{
background:#333 !important;}

.footerbg a{
color:#fff !important;}

.other-info .weibo.left a{
background:none no-repeat!Important;
background-image:url(data:image/png;base64,) !important}

.other-info .rss.left a{
background:none no-repeat !Important;
background-image:url(data:image/png;base64,) !important}

.other-info .mail.left a{
background:none no-repeat!Important;
background-image:url(data:image/png;base64,) !important}

.other-info  a:hover{
transform:rotate(360deg);
transition:transform 0.25s linear;}

.footer-channel,.sitemap-info {
background:0% 50% no-repeat;
background-image:url(data:image/png;base64,)}

.footer-channel a {
padding-bottom:70px !important;}

.footer-channel a img{
visibility:hidden !Important;}

#getCalendar {background:#bbb !important;
color:#000 !important;
width:85px !important;}

#getCalendar:after {
content:"　▲"}



.ep-header {
margin-top:-20px !important;}


.subfoot-wrap,#js_N_nav_footer {
background:#333 !important;}

.sitemap-info a {
background:none !important;}

.sitemap-con {
background:#bbb !important;}

.sitemap-con:hover {
background:#206F96 !important;}

#js_N_nav_footer .i-entry {color:white !important;}


#endText {
background:#F6FCFF !important;
}

.ep-content-main{
margin-top:-25px; 
background:#F6FCFF !important;
border:1px solid #DDDDDD;
padding:10px;
}

.ep-content-side{
margin-top:-25px; 
}

.ep-summary{
background:white !important;
border:1px solid #DDDDDD;
 }

.ep-header > .ep-area:nth-of-type(2) {
display:none !important;}


iframe[width="590"] {
display:none !important;}


#js-epTabDS,.gg300,.gg360,
.colR > .rightContent:nth-of-type(14),
.ep-content-side .blank15,
.ep-content-side .mod-imglist.ep-imglist-1.clearfix:nth-of-type(8),
.ep-content-side .ep-title-2.clearfix:nth-of-type(11),
.ep-content-side .mod-imglist.ep-imglist-1.clearfix:nth-of-type(6),
.colR > .rightContent:nth-of-type(13),
.ep-content-side .ep-title-2.clearfix:nth-of-type(13),
.ep-content-side .mod-imglist.ep-imglist-1.clearfix:nth-of-type(7),
.ep-content-side .ep-title-2.clearfix:nth-of-type(14),
.ep-content-side .ep-title-2.clearfix:nth-of-type(19),
iframe[src^='http://top.baidu'],
.colR > .rightContent:nth-of-type(8),
.colR > .rightContent:nth-of-type(9),
#crossiframe, 
.colR > .rightContent >.blank9 
{display:none !important;
border:none !Important;}
}
